value.value:
csvFile -> {
 data = $csvFile.get(`test.transient:CSVFile#file`);
 parsed = $data.parseCSV(trimSpaces:true, 
    parsers: {
      "Datum": x-> dateFormat("dd.MM.yy").format(dateFormat("dd.MM.yyy").parse($x)), 
      "Name": y -> toUpperCase($y),
      "Differenz": z -> numberFormat("#0.00").parse($z),
      "NonHeader": xy -> "Error"
      }
 );
 $parsed.toString()
}
